function Start(idActor, idActorDetector)
	if(Hydra.ActorIsAlive(idActor)) then
		Hydra.ActorDisable(BOSS_TRIGGER);
		Hydra.EventSend("Frac_Underworld_04_BossStart");
	else
		--Do nothing!
	end
end

function Start()
	--Hydra.TraceScreen("Vignette QST_VGN_Frac_Underworld_04_TempVhenard completed")
	
	-- End Boss Encounter
	Hydra.BossEncounterManuallyComplete(BOSS_LEVEL_AREA);
	
	-- Cleanup Vhenard, Quest uses its own NPC Vhenard for death scene
	local boss = Hydra.ActorsLinkedByActorInGroup(idSelf, "BOSS")
	for i, bossID in ipairs(boss) do
		Hydra.ActorDisable(bossID);
	end	
	
	Hydra.ActorFlagDynamicPrefabGroupForDespawn(idSelf);
end

